import React from 'react'

export default function WelcomeMeditationScreen({navigation}) {
  return (
    <View style={styles.container}>
      <ImageBackground source={{uri: "https://addicted2success.com/wp-content/uploads/2013/05/Meditation-Techniques.jpg"}} resizeMode="cover" >

      </ImageBackground>
    </View>
  )
}

const styles = StyleSheet.create({
    container: {
        flex : 1,
    },
    image:{
        flex: 1,
        justifyContent: 'center'
    }
})
